class Topic {
    String subject1, subject2, outcome;

    String findSpeechOutcome() {
        return "My " + subject1 + " speech was about " + subject2 + outcome + ".";
    }
}

class GayRights {

    public static void main(String[] args) {

        Topic topic = new Topic();
        topic.subject1 = "gay rights";
        topic.subject2 = "the subject";
        topic.outcome = "is controversial";

        System.out.println(topic.findSpeechOutcome());
    }
}

// My gay rights speech was about the subject, is controversial.

